import React from 'react';
import TodoAdd from './components/Todo/TodoAdd';
import TodoList from './components/Todo/TodoList';

export const ToDo_App = ()=> {
    return (
        <form onSubmit={(e) => e.preventDefault()}>
            <TodoAdd />
            <TodoList />
        </form>
    );
}
